import React from "react";
import "./style.css";
import avatar from './avatar.png'
const MentorApprove = () => {
  return (
    <div>
    <h3>Janet Figueroa</h3>
    <img src={avatar}/>

    <h4 class="thanks">Thank you!</h4>
    <h4 class="message">Your information has been sent to Janet.</h4>
    </div>
  );
};

export default MentorApprove;
